const n = (t, o = 0) => {
  const e = 100 / t.getViewport({ scale: 1 }).width, i = t.getViewport({ scale: e, rotation: o });
  return { scale: e, thumbnailViewport: i };
};
export {
  n as getThumbnailViewport
};
